/*Data for the table `document` */

insert  into `document`(`document_id`,`document_title`,`document_template`,`doc_folder_id`,`doc_category_id`,`status`,`created_on`,`updated_on`,`form_steps`) values (14,'Some Template','<p>Dear {firstname},</p>\r\n<p>Welcome to Leica Biosystems. We are taking you on as a {designation} with compensation of {salary}.</p>\r\n<p>&nbsp;</p>\r\n<p>Regards,</p>\r\n<p>Rohit Naik</p>\r\n<p>{signature_hr_admin}</p>\r\n<p>&nbsp;</p>\r\n<p>Acknowledgement Note : {acknowledgement_note}</p>\r\n<p>&nbsp;</p>',7,8,1,'2019-01-23 12:12:19','2019-01-24 11:53:33',2),(15,'Joining Letter','<p>Dear {first_name},</p>\r\n<p>Welcome to our Organization. You are employed with our organization effective {joining_date}. Your designation will be {designation}.</p>\r\n<p>Please sign this letter as acceptance.</p>\r\n<p>&nbsp;</p>\r\n<p>Warm Regards,</p>\r\n<p>{signature_hr_admin}</p>\r\n<p>HR Admin</p>\r\n<p>&nbsp;</p>\r\n<p>I accept the offer.</p>\r\n<p>{signature_new_associate}</p>',7,8,1,'2019-01-23 12:15:50','0000-00-00 00:00:00',2),(16,'Offer Letter','<p>Dear {first_name},</p>\r\n<p>&nbsp; Do you accept this fantastic offer. I don\'t believe you will get a better one anywhere. If you do please sign below my signature.</p>\r\n<p>&nbsp;</p>\r\n<p>HR ADMIN</p>\r\n<p>{signature_hr_admin}</p>\r\n<p>&nbsp;</p>\r\n<p>I accept this absolutely fantastic offer.</p>\r\n<p>&nbsp;</p>\r\n<p>ASSOCIATE</p>\r\n<p>{signature_new_associate}</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>',7,8,1,'2019-01-23 13:16:54','2019-01-31 10:55:30',2),(17,'Thank you note','<p>Hi,</p>\r\n<p>{thank_you_note}</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>{signature_new_associate}</p>',8,9,1,'2019-01-24 11:24:40','0000-00-00 00:00:00',1),(18,'Test letter','<p>This is a test letter.</p>\r\n<p>{signature_hr_admin}</p>\r\n<p>&nbsp;</p>\r\n<p>I accept</p>\r\n<p>{signature_new_associate}</p>',7,8,1,'2019-01-28 06:19:26','2019-02-13 09:45:33',2),(19,'Testing Document','<p>Hello {name},</p>\r\n<p>This is testing document.</p>\r\n<p>&nbsp;</p>\r\n<p>{signature_hr_admin}</p>\r\n<p>&nbsp;</p>\r\n<p>{full_name} is new associate.</p>\r\n<p>{signature_new_associate}</p>',7,8,1,'2019-01-31 09:39:33','0000-00-00 00:00:00',2),(20,'GM_Two_Signature Form','<p>Dear {first_name},</p>\r\n<p>&nbsp;</p>\r\n<p>This is a document to create couple of signatures. One for the HR Admin</p>\r\n<p>{signature_hr_admin}</p>\r\n<p>&nbsp;</p>\r\n<p>I, {first_name} {last_name} And the second one for the New Associate.</p>\r\n<p>{signature_new_associate}</p>\r\n<p>&nbsp;</p>',7,8,1,'2019-02-04 06:36:04','0000-00-00 00:00:00',2),(21,'GM_One_Step_Form','<p>Dear {first_name},</p>\r\n<p>&nbsp; Please sign the doucment here and return.</p>\r\n<p>&nbsp;</p>\r\n<p>Signature,</p>\r\n<p>{signature_new_associate}</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>\r\n<p>&nbsp;</p>',8,9,1,'2019-02-04 06:42:31','0000-00-00 00:00:00',1),(22,'Test Doucment','',7,8,1,'2019-02-10 06:46:51','2019-02-13 04:09:41',2),(23,'Communication Document','<p>Hello <a class=\"active-variable justify-content-between list-group-item list-group-item-action border-0\" data-field_name=\"FirstName\" data-varname=\"{firstname}\">{firstname}<span class=\"badge badge-primary badge-pill\">HR Associate,</span></a></p>\r\n<p>This is a test.</p>\r\n<p><a class=\"active-variable justify-content-between list-group-item list-group-item-action border-0\" data-field_name=\"HRSignature\" data-varname=\"{hrsignature}\">{hrsignature}<span class=\"badge badge-primary badge-pill\">HR Associate</span></a></p>\r\n<p>&nbsp;</p>\r\n<p><span class=\"badge badge-primary badge-pill\">I acknowledge</span></p>\r\n<p><a class=\"active-variable justify-content-between list-group-item list-group-item-action border-0\" data-field_name=\"NewAssociate\" data-varname=\"{newassociate}\">{newassociate}<span class=\"badge badge-primary badge-pill\">New Associate</span></a></p>',7,8,1,'2019-02-13 04:09:07','2019-02-13 04:12:08',2);

